  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Department of Commerce, National
  Oceanic and Atmospheric Administration (NOAA) Atlantic Oceanograpic and Meteorologicaln
  \              Laboratories (AOML) formerly operated a geosample repository which
  stored ocean floor cores and grabs collected during their marine geology research
  activities.n               The repository housed 968 cores, grabs, and suspended
  sediment samples from multiple cruises of the ships Ferrel and Researcher collected
  from 1974 through 1981. n               The AOML repository was decommissioned and
  samples previously curated by AOML are no longer available for study.  n               Prior
  to closing the repository, AOML coded and sent data and information related to their
  sample collection to NCEI (formerly NGDC) for long-term archive, and for n               discoverability
  via the Index to Marine and Lacustrine Geological Samples (IMLGS) database.\",\n\t\"license_title\":
